import React from 'react';

const Registration  = () => {
    return(
        <>
            <section className='registration' id='registration'>
                <div className='container'>
                    <div className='row'>
                        <h2>Registration</h2>
                        <div className='col-md-7'>form</div>
                        <div className='col-md-5'></div>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Registration
